import React, { useEffect } from "react";
import "./home.css";
import AOS from "aos";
import "aos/dist/aos.css";

const Vision = () => {
  useEffect(() => {
    AOS.init({ duration: 1000, once: true }); // Initialize AOS
  }, []);


return (
    <div>
     

{/* Company Vision */}
      <div

        className="container3"
        style={{
          backgroundImage: "url('/images/bg2.png')", // Replace with your background image path
          backgroundRepeat: "no-repeat",
          backgroundPosition: "center",
          backgroundSize: "cover",
        }}
        
      >
      </div>

            {/* Overlay Text */}
            <div
          className="text-overlay1"
          data-aos="fade-up"
          style={{
            position: "absolute",
            textAlign: "center",
            color: "white",
            background: "rgba(0, 0, 0, 0.6)", // Dark overlay effect
            padding: "20px",
            borderRadius: "10px",
            width: "60%",
          }}
        >
          <h1 style={{ fontSize: "2.5rem", marginBottom: "10px" }}>Our Vision</h1>
          <p style={{ fontSize: "1.2rem" }}>
            We aim to revolutionize the industry by providing cutting-edge solutions and sustainable growth.
          </p>
        </div>


    </div>
  );
};

export default Vision;
